    string convertImageToDisplay(byte[] Afbeelding)
    {
        if (Afbeelding != null)
        {
            var base64 = Convert.ToBase64String(Afbeelding);
            var fs = string.Format("data:image/jpg;base64,{0}", base64);
            return fs;
        }
